import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [movies, setMovies] = useState([]);

  useEffect(() => {
    axios.get("/movies").then((response) => {
      console.log(response.data);
      setMovies(response.data);
    });
  }, []);

  return (
    <div className="App">
      {movies.map((movie) => {
        movie.title;
      })}
    </div>
  );
}

export default App;
